// src/components/SignUpForm.js
import React from 'react';
import '../styles/SignUpForm.css';

const SignUpForm = () => {
  return (
    <div className="sign-up-form">
      <h1>Đăng Ký</h1>
      <button className="social-btn google">
        <i className="fab fa-google"></i>
        <span>Đăng ký với Google</span>
      </button>
      <button className="social-btn facebook">
        <i className="fab fa-facebook"></i>
        <span>Đăng ký với Facebook</span>
      </button>
      <div className="or-divider">hoặc</div>
      <form>
        <label>Họ và Tên</label>
        <input type="text" placeholder="Ví dụ: Mai Thái Huy" required />
        <label>Email</label>
        <input type="email" placeholder="Ví dụ: abcxyz@gmail.com" required />
        <label>Số Điện Thoại</label>
        <input type="tel" placeholder="Ví dụ: 0123456789" required />
        <label>Mật Khẩu</label>
        <input type="password" placeholder="Nhập mật khẩu của bạn" required />
        <button type="submit">Đăng Ký</button>
      </form>
      <p>Bạn đã có tài khoản? <a href="/signin">Đăng nhập</a></p>
    </div>
  );
};

export default SignUpForm;
